import React from "react";

const PostPage =()=>{
    return(
        <main>
            <Link to="/postpage/1">Post 1</Link><br/>
            <Link to="/postpage/2">Post 2</Link><br/>
            <Link to="/postpage/3">Post 3</Link>
        </main>
    );
}
export default PostPage;
